import stylesMenuItems from "./stylesMenuItems.module.css";

function MenuItems() {
  return (
    <div className={stylesMenuItems.box}>
      <p
        className={`${stylesMenuItems.ml_76px}text text_type_main-default`}
      ></p>
      <p>Соусы</p>
      <p className={stylesMenuItems.mr_76px}>Начинки</p>
    </div>
  );
}

export default MenuItems;

